import Header from './header';
import Head from 'next/head';
import Todos from './todos';



class Layouts extends React.Component {
    render(props) {
      return (
        <div>
            <Head>
                <title>Todo App</title>
            </Head>
            <Header />
            <Todos />

            {this.children}
        </div>
        
      );
    }
  }
  
  export default Layouts;
